import React from "react";
import NavBar from "./Navbar";

function Content(props) {
  return (
    <NavBar
      changeView={props.changeView()}
      setSearchTerm={props.setSearchTerm}
      searchproject={props.searchproject}
    />
  );
}

export default Content;
